import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, NavLink } from 'react-router-dom';
import Rooms from './Rooms.jsx';
import Guests from './Guests.jsx';
import FrontDesk from './FrontDesk';
// import Rate from './Rate';
import Bookings from './Bookings';
// import Settings from './Settings';
// import Help from './Help';
import { dashboardApi } from './lib/supabase';
import './Navbar.css';

const sidebarItems = [
  { name: 'Dashboard', icon: 'üè†', path: '/' },
  { name: 'Rooms', icon: 'üõèÔ∏è', path: '/rooms' },
  { name: 'Guests', icon: 'üë§', path: '/guests' },
  { name: 'Front Desk', icon: 'üõéÔ∏è', path: '/front-desk' },
  // { name: 'Rate', icon: 'üí≤', path: '/rate' },
  { name: 'Bookings', icon: 'üìñ', path: '/bookings' },
  // { name: 'Settings', icon: '‚öôÔ∏è', path: '/settings' },
  // { name: 'Help', icon: '‚ùì', path: '/help' },
];

function Dashboard() {
  return (
    <main className="flex-1 p-8 overflow-y-auto">
      {/* Overview Cards */}
      <section className="mb-8">
        <h2 className="text-xl font-semibold mb-4">Overview</h2>
        <div className="grid grid-cols-1 md:grid-cols-4 gap-4">
          {[
            { title: "Today's Check-in", value: 10, change: '+2 from yesterday', icon: '‚û°Ô∏è' },
            { title: "Today's Check-out", value: 10, change: '-1 from yesterday', icon: '‚û°Ô∏è' },
            { title: 'Total Available Rooms', value: 10, change: '0 since yesterday', icon: 'üöó' },
            { title: 'Total Occupied Rooms', value: 10, change: '+1 since yesterday', icon: 'üè†' },
          ].map((card, idx) => (
            <div key={idx} className="bg-[#232f47] rounded-lg p-5 flex flex-col gap-2 shadow">
              <div className="flex items-center justify-between">
                <span className="text-sm text-gray-300">{card.title}</span>
                <span className="text-lg">{card.icon}</span>
              </div>
              <div className="text-3xl font-bold">{card.value}</div>
              <div className="text-xs text-green-400">{card.change}</div>
            </div>
          ))}
        </div>
      </section>
      {/* Rooms Section */}
      <section className="mb-8">
        <div className="flex items-center justify-between mb-4">
          <h2 className="text-xl font-semibold">Rooms</h2>
          <button className="bg-[#232f47] px-4 py-2 rounded text-sm font-semibold hover:bg-[#2d3a56] transition">View All Rooms</button>
        </div>
        <div className="grid grid-cols-1 md:grid-cols-4 gap-4">
          {/* Room Cards */}
          {[
            {
              name: 'Studio Room',
              img: 'https://images.unsplash.com/photo-1506744038136-46273834b3fb?auto=format&fit=crop&w=400&q=80',
              occupied: '2/5',
              price: '‚Ç± 1,400/night',
              amenities: ['Free WiFi', 'Smart-TV', 'Desk', '+1 more'],
            },
            {
              name: 'Double Superior',
              img: 'https://images.unsplash.com/photo-1512918728675-ed5a9ecdebfd?auto=format&fit=crop&w=400&q=80',
              occupied: '2/5',
              price: '‚Ç± 1,500/night',
              amenities: ['Free WiFi', 'Smart-TV', 'Desk', '+1 more'],
            },
            {
              name: 'Twin Superior',
              img: 'https://images.unsplash.com/photo-1464983953574-0892a716854b?auto=format&fit=crop&w=400&q=80',
              occupied: '2/5',
              price: '‚Ç± 1,600/night',
              amenities: ['Free WiFi', 'Smart-TV', 'Desk', '+1 more'],
            },
            {
              name: 'Junior Suite',
              img: 'https://images.unsplash.com/photo-1502691876148-a84978e59af8?auto=format&fit=crop&w=400&q=80',
              occupied: '2/5',
              price: '‚Ç± 2,200/night',
              amenities: ['Free WiFi', 'Smart-TV', 'Sofa', '+2 more'],
            },
          ].map((room, idx) => (
            <div key={idx} className="bg-[#232f47] rounded-lg overflow-hidden shadow flex flex-col">
              <img src={room.img} alt={room.name} className="h-32 w-full object-cover" />
              <div className="p-4 flex-1 flex flex-col">
                <div className="font-semibold text-lg mb-1">{room.name}</div>
                <div className="text-xs text-gray-400 mb-2">{room.occupied} occupied</div>
                <div className="font-bold text-base mb-2">{room.price}</div>
                <div className="flex flex-wrap gap-2 mb-2">
                  {room.amenities.map((a, i) => (
                    <span key={i} className="bg-[#1a253a] text-xs px-2 py-1 rounded text-green-300">{a}</span>
                  ))}
                </div>
                <div className="flex gap-2 mt-auto">
                  <button className="bg-blue-600 hover:bg-blue-700 text-white px-3 py-1 rounded text-xs">View Details</button>
                  <button className="bg-white text-blue-700 px-3 py-1 rounded text-xs">Book Now</button>
                </div>
              </div>
            </div>
          ))}
        </div>
      </section>
      {/* Room Status Placeholder */}
      <section>
        <h2 className="text-xl font-semibold mb-4">Room Status</h2>
        <div className="bg-[#232f47] rounded-lg p-8 text-center text-gray-400">Room status details go here...</div>
      </section>
    </main>
  );
}

function App() {
  return (
    <Router>
      <div className="flex min-h-screen bg-[#151e2e] text-white">
        {/* Sidebar */}
        <aside className="sidebar">
          <div className="sidebar-logo">
            <div className="sidebar-logo-icon">M</div>
            <div>
              <div className="sidebar-logo-title">GOLD ROCK</div>
              <div className="sidebar-logo-sub">INN</div>
            </div>
          </div>
          <nav className="sidebar-nav">
            {sidebarItems.map((item) => (
              <NavLink
                key={item.name}
                to={item.path}
